const defaultState = {
   signInData: {
      username: '',
      password: ''
   }
}

const loginReducer = (state=defaultState, action) => {
   switch(action.type) {
      case "UPDATED_LOGIN":
         console.log('Updated')
         return action.signInData
      case "RESETTED_LOGIN":
         return defaultState
      default:
         return state
   }
}

export default loginReducer
